        <div>
        <Header />

        <h1>Results...</h1>

{data.filter((item) =>{
    if(state.st ===""){
        return noResult;
    }
    else if(item.title.toLowerCase().includes(state.st.toLowerCase())){
        return item;
    }
}).map((item) => {
        return(
            <Cards key={item.id} item={item} />
